import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import Nav from 'react-bootstrap/Nav';



function Adoptables(){
    return (
      <div className="adoptables">
        <Container fluid>
          <Row className="text-adopt">
            <Col xs={6} md={4}><Nav.Link className="adopt-text" href="/adoptabledogs"><h1 >ADOPTABLE DOGS</h1>  </Nav.Link></Col>
            <Col ><h1 >|</h1></Col>
            <Col xs={6} md={4}><Nav.Link className="adopt-text" href="/adoptablecats"><h1 >ADOPTABLE CATS</h1>  </Nav.Link></Col>
          </Row>
        </Container>
    </div>
    )
}
export default Adoptables;
